// Running the fetch method
fetch(API_URL)
  .then((response) => {
    // We need to "unpack" the response object using the json() method
    return response.json();
  })
  .then((data) => {
    console.log("Data from fetch", data);
  })
  .catch((response) => {
    // Whoops, something went wrong
    console.log("ERROR");
  });
